import { Col, Row } from "react-bootstrap"
import "./YoutubeShowcase.css"
import YouTube from "react-youtube";
var getYouTubeID = require("get-youtube-id");

const YoutubeShowcase = () => {

    const opts = {
        height: "390",
        width: "640",
        playerVars: {
          // https://developers.google.com/youtube/player_parameters
          autoplay: 1
        }
      };

    return (
        <div className = "bgY">
            <Row><div className = "showcaseTitle">Youtube Showcase</div></Row>
            <Row><div className = "showcaseChannel">Bryan Delimata</div></Row>
            <Row>
                <Col>
                    <div classname = "showcaseDescription">Visual artist making youtube tutorials. With tons of tutorial in both Premier Pro and After Effects to help give your videos another level of editing</div>
                </Col>
                <Col>
                    <YouTube videoId={getYouTubeID("https://www.youtube.com/watch?v=1uw6tf28Yr4")} opts={opts}/>
                </Col>
            </Row>
        </div>
    )

}

export default YoutubeShowcase
